import { Routes, Route } from "react-router-dom"
import Home from "./routes/home/Home"


const Buy = () => {
  return <h1>This is your cart shop </h1>
}

const App = () => {
  return (
    <Routes>
      <Route path="/home" element={ <Home /> } >
          <Route path="buy" element={<Buy />}/>
      </Route>

    </Routes>

  )
}

export default App
